class Prices extends Component {
  state = {
    currency: "USD"
  };
  render() {
    return (
      <div>
        <ul className="list-group">
          <li className="list-group-item">BitCoin rate for {}</li>
        </ul>
      </div>
    );
  }
}

export default Prices;
